		function highlightFeature(e)
		{

			this.openPopup();
			var layer = e.target;

			layer.setStyle({
				weight: 5,
				color: '#FFFFFF',
				dashArray: '',
				fillOpacity: 0.7
			});

			if (!L.Browser.ie && !L.Browser.opera)
			{
				layer.bringToFront();
			}
		}

		// odstranenie zvyraznenia
		function resetHighlight(e)
		{
			this.closePopup();
			var layer = e.target;

			layer.setStyle({

				weight: 2,
				color: 'white',
				dashArray: '3',
				fillOpacity: 0.9
			});
		}

