		{
			loadMarkers();
			while (map.hasLayer(krajeLayer))
			{
				map.removeLayer(krajeLayer);
			}
			while (map.hasLayer(okresyLayer))
			{
				map.removeLayer(okresyLayer);
			}
			if (map.hasLayer(markersLayer))
			{
			}
			else
			{
				map.addLayer(markersLayer);
			}

		}


		function loadMarkers()
		{
			// check zoomu
			if (map.getZoom() < zoomLevO2M)
			{
				if (map.hasLayer(markersLayer))
				{
					map.removeLayer(markersLayer);
				}
				uniqueMarkerSet = null;
				markersLayer.clearLayers();
				nelat_actual = 0;
				swlat_actual = 0;
				nelng_actual = 0;
				swlng_actual = 0;
				return;
			} else
			{
			}

			if (uniqueMarkerSet == null) {
                uniqueMarkerSet = new Set();
            }
			var bounds = map.getBounds();

			if (nelat_actual > bounds._northEast.lat && swlat_actual < bounds._southWest.lat && nelng_actual > bounds._northEast.lng && swlng_actual < bounds._southWest.lng) return;

			nelat_actual = bounds._northEast.lat + (bounds._northEast.lat - bounds._southWest.lat) * window_oversize;
			swlat_actual = bounds._southWest.lat - (bounds._northEast.lat - bounds._southWest.lat) * window_oversize;
			nelng_actual = bounds._northEast.lng + (bounds._northEast.lng - bounds._southWest.lng) * window_oversize;
			swlng_actual = bounds._southWest.lng - (bounds._northEast.lng - bounds._southWest.lng) * window_oversize;


			jQuery.ajax({
					type: "GET",
					url: "http://konania.sk/api/markery",
					data: {"nelat": nelat_actual, "nelon": nelng_actual, "swlat": swlat_actual, "swlon": swlng_actual},
					dataType: 'json',
					success: function (data)
					{

						jQuery(data).each(function ()
						{
							if (uniqueMarkerSet.has(this.id) == false)
                            //if(true)
							{
                                uniqueMarkerSet.add(this.id);
								var marker = new L.Marker(new L.LatLng(this.gps_lat, this.gps_lon));
                                marker.bindPopup(
	                                '<div class="row">'+
		                                '<div class="col-lg12 center-align">'+
	                                        '<h5>' + this.title + '</h5>' +
		                                '</div>'+
	                                '</div>'+
	                                '<div class="row">'+
		                                '<div class="col-lg12">'+
			                                '<button id="'+this.id+'" class="markerdetailview btn waves-effect waves-light red-color-background max-width" type="submit" name="action">Viac o stavbe'+
				                                //'<i class="material-icons right">send</i>'+
			                                '</button>' +
	                                    '</div>'+
	                                '</div>'+
	                                '<div class="row">'+
		                                '<div class="col-lg12">'+

			                                    '<a style="color:white;" class="btn waves-effect waves-light red-color-background max-width" href="' + this.url + '">Strnka stavebnho radu</a>' +

		                                '</div>'+
	                                '</div>'+
	                                '<div class="row">'+
	                                    '<div class="col-lg12">'+

			                                    '<a style="color:white;" class="btn waves-effect waves-light red-color-background max-width" href="' + this.file_reference + '">Sbor</a>'+

	                                    '</div>'+
	                                '</div>'
                                ).openPopup();
								marker.on('mouseover', function (e)
								{
									this.openPopup();
								});
								marker.on('mouseout', function (e)
								{
									// this.closePopup();
								});
								markersLayer.addLayer(marker);
							}
						});
						map.addLayer(markersLayer);
					}
				}

				, "json");
		}

